<?php

namespace Tests\Feature;

use Tests\TestCase;
use Illuminate\Support\Facades\Auth;
use Illuminate\Foundation\Testing\WithFaker;
use Illuminate\Foundation\Testing\RefreshDatabase;


class AuthTest extends TestCase
{
    private $image = "data:image/jpeg;base64,";
    
    /**
     * A basic feature test example.
     *
     * @return void
     */
    // use RefreshDatabase;


    public function test_an_user_can_be_deleted_from_the_bdd()
    {
        $response = $this->delete('api/destroyUser/2');

        $response->assertOk()

        ->assertJson([

            "message" => "User deleted."
        ]);


    }

    public function test_an_user_can_be_added_to_the_bdd()
    {
        $response = $this->post('/api/register', [

            'firstName' => 'nicolas',
            'lastName' => 'merreil',
            'pseudo' => 'nico',
            'email' => 'nicolas.merreil@gmail.com',
            'password' => 'nicolas82',
            'confirm_password' => 'nicolas82',
            'uRole' => '1',
            'numero' => '1',
            'rue' => 'rue des primeveres',
            'codepostal' => '91000',
            'ville' => 'EVRY',

        ]);
        $response->assertOk()


            ->assertJson([

                "message" => "User created successfully."

            ]);
    }



    public function test_an_user_can_be_logged()
    {
        $response = $this->post('/api/login', [

            'email' => 'nicolas.merreil@gmail.com',
            'password' => 'nicolas82',

        ]);
        $response->assertOk()

            ->assertJson([
                'message' => 'User signed in',

            ]);
    }

    public function test_an_user_cant_be_logged()
    {
        $response = $this->post('/api/login', [

            'email' => 'merreil@gmail.com',
            'password' => 'nicolas82',

        ]);
        $response->assertNotFound()

            ->assertJson([
                'success' => false,
                'message' => 'Unauthorised.',
                "data" => [
                    "error" => "Unauthorised"
                ]


            ]);
    }



    public function test_an_admin_can_read_all_the_users_informations()
    {
        $response = $this->get('/api/users', []);
        $response->assertOk();
    }

    public function test_an_admin_can_read_one_user_informations()
    {
        $response = $this->get('/api/getuser/2', []);
        $response->assertOk();
    }


    public function test_an_admin_can_update_an_avatar_of_one_user_into_the_bdd()
    {


        $response = $this->put('/api/users/updatea/2', [

            'avatar' => $this->image,

        ]);
        $response->assertOk();
    }

    public function test_an_admin_can_update_the_informations_of_one_user_into_the_bdd()
    {

        $response = $this->put('/api/users/updatei/2', [


            'firstName' => 'nicolas',
            'lastName' => 'merreil',
            'pseudo' => 'nico',
            'email' => 'nicolas.merreil@gmail.com',
            'numero' => '1',
            'rue' => 'rue des primeveres',
            'codepostal' => '91000',
            'ville' => 'EVRY',


        ]);
        $response->assertOk();
    }


    public function test_an_admin_can_update_the_informations_of_an_admin_into_the_bdd()
    {

        $response = $this->put('/api/users/updateadmin/2', [


            'firstName' => 'nicolas',
            'lastName' => 'merreil',
            'pseudo' => 'nico',
            'uRole' => '1',
            'email' => 'nicolas.merreil@gmail.com',
            'numero' => '1',
            'rue' => 'rue des primeveres',
            'codepostal' => '91000',
            'ville' => 'EVRY',


        ]);
        $response->assertOk();
    }

    public function test_an_admin_or_user_can_update_his_password_into_the_bdd()
    {

        $response = $this->put('/api/users/updatep/2', [


            'password' => 'nicolas',
            'confirm_password' => 'nicolas',


        ]);
        $response->assertOk();
    }
}
